function populateMonthBlogNavigation(mElementId,yElementId,startDate,yearCount,monthNames){mSelect=document.getElementById(mElementId);ySelect=document.getElementById(yElementId);selectionDate=new Date();d=new Date();if(startDate!=null&&(startDate.length>0)){selectionDate=Calendar.parseDate(startDate,false)}for(i=0;i<yearCount;i++){ySelect.options[i]=new Option(d.getFullYear()-i,d.getFullYear()-i)}var names=monthNames.split(",");for(var i=0;i<names.length;i++){if(i<9){opVal="0"+(i+1)}else{opVal=""+(i+1)}mSelect.options[i]=new Option(names[i],opVal)}ySelect.selectedIndex=d.getFullYear()-selectionDate.getFullYear();mSelect.selectedIndex=selectionDate.getMonth()}function submitBlogNavigation(sectionUrl,mElementId,yElementId){var mValue=document.getElementById(mElementId).value;var yValue=document.getElementById(yElementId).value;var month=parseInt(mValue);var year=parseInt(yValue);if(month==12){year=year+1;month=0}date=Calendar.intToDate(Calendar.dateToInt(new Date(year,month,1))-1);window.location.href=sectionUrl+"?start=01-"+mValue+"-"+yValue+"&end="+date.getDate()+"-"+mValue+"-"+yValue};